INSERT INTO `familytree_app_instructions` VALUES (1,'1','આ વેબસાઇટ મારા અંગત ઉપયોગ માટે બનાવવામાં આવી છે. જો કે કોઈપણ વ્યક્તિ તેનો ઉપયોગ પોતાના જોખમ અને જવાબદારી પર કરી શકે છે.'),(2,'3','આ માહિતી અંદાજે 10-11 વર્ષ પહેલાની હોય જો તમારું સરનામું અને મોબાઈલ નંબર બદલાયો હોય, તો home page માં સૂચના આપ્યા પ્રમાણે ફેરફાર કરાવો.'),(3,'4','નવું નામ ઉમેરવા home page માં લીંક આપેલી છે'),(4,'5','તમારી અન્ય કોઈપણ વિગતો માં ફેરફાર કરવા home page માં લીંક આપેલી છે. આ વેબસાઇટ માંથી તમારી ID નોંધી લ્યો. જેથી ફેરફાર કરવામાં સરળતા રહે.'),(5,'2','સૌપ્રથમ કૃપા કરીને સર્ચ બોક્સમાં તમારું નામ અથવા અટક અથવા સરનામું શોધીને તમારી પોતાની માહિતી લખેલી છે કે નહીં તે તપાસો.'),(6,'6','પત્ની ની વિગત ઉમેરવા માટે ભવિષ્ય માં અલગથી લિંક મુકવામાં આવશે.'),(7,'7','વધુ ઉપયોગીતા માટે આ વેબસાઈટમાં ભવિષ્યમાં સંજોગો પ્રમાણે સુધારો કરવામાં આવશે.'),(8,'8','ઉદ્દેશ માત્ર: સૌ ને એડ્રેસ શોધવામાં સરળતા રહે.');
